package JAVA_PROGRAMS;

public class switch_case2 {

	public static void main(String[] args) {
		// TODO Auto-generated method stub

		
		int number = 50;
		
		switch(number)
		
		{
		
		case 10 :
		System.out.println("this is switch case 10");
		break; 
		
		case 20 :
		System.out.println("this is switch case 20");
		break;
		
		case 30 :
		System.out.println("this is switch case 30");
		break;
		
		case 40 :
		System.out.println("this is switch case 40");
		break;
		
		case 50 :
		System.out.println("this is switch case 50");
		break;
		
		default :
		System.out.println("this is switch case 60");	
		
		
		
		}
		
		
	}

}
